graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  subgraph cluster_Group {
    label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>Group</b></td></tr></table>>;
    labelloc="t";
    style=filled;
    fontsize=10;
    fillcolor="#FFFFFF";
    color="#999999";
    "Group__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

    "Child" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Child</b> <i>&lt;task&gt;</i></td></tr><tr><td align="left">Simple child</td></tr></table>>, pad=0.5, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2", URL="#L2:4-2:30"];

    "note_Group_0" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>, shape=note, fillcolor="#FFFACD", style=filled, fontsize=9];
    "note_Group_0" -> "Group__cluster_anchor" [style=dashed, color="#999999", arrowhead=none];
    "note_Child_0" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left">Explicit qualified child</td></tr></table>>, shape=note, fillcolor="#FFFACD", style=filled, fontsize=9];
    "note_Child_0" -> "Child" [style=dashed, color="#999999", arrowhead=none];
  }
  "Start" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Start</b></td></tr></table>>, pad=0.5, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];

  // Edges
  "Start" -> "Child" [labelOverlay="75%", edgeURL="#L7:6-7:14"];
  "Child" -> "Child" [labelOverlay="75%", edgeURL="#L8:6-8:20"];
}
